import socket
import time 

HOST = '192.168.10'
PORT = 10589

def main():
    with socket.socket(socket.AF_INET, socket.SOCK_STREAM) as s:
      s.connect((HOST, PORT))
      skeleton = 'Passepartout'.encode()
      s.sendall(skeleton)
      Aspam = ''.encode()
      s.send(Aspam)
      s.recv(2048)
   
if __name__ == '__main__':
    main()